    return (
        <div className="collapsible">
            <div className="header1" {...getToggleProps()}>
                {isExpanded ? 'Collapse' : 'Know More'}
            </div>
            <div {...getCollapseProps()}>
                <div className="content1">
                {/* {props.data ? props.data.paragraph : 'loading...'} */}
                   lorem ip
                </div>
            </div>
        </div>
    );
}

export default Collapsible;
